import React, { useEffect, useState } from "react";
import './modal.css';

const Post = (props) => {
  const { open, close, data } = props;


  return (
    <div className={open ? 'openModal modal' : 'modal'}>
      {open ? (
        <section>
          <header>
            <button className="close" onClick={close}>
              {' '}
              &times;{' '}
            </button>
          </header>
          <main>
            <span>{data.name}</span> <span>{data.type_code}</span>
            <p>{data.addr}</p>
            <p>{data.coord}</p>
            <p>{data.postNo}</p>
            <p>{data.telno}</p>
            <p>{data.hospUrl}</p>
            <p>{data.estbed}</p>
            <p>{data.drTotCnt}</p>

            <p>한방일반의: {data.cmdGdrCnt}</p>
            <p>한방인턴: {data.cmdIntnCnt}</p>
            <p>한방레지던트: {data.cmdResdntCnt}</p>
            <p>한방전문의: {data.cmdSdrCnt}</p>

            <p>치과일반의: {data.detyGdrCnt}</p>
            <p>치과인턴: {data.detyIntnCnt}</p>
            <p>치과레지던트: {data.detyResdntCnt}</p>
            <p>치과전문의: {data.detySdrCnt}</p>

            <p>의과일반의: {data.mdeptGdrCnt}</p>
            <p>의과인턴: {data.mdeptIntnCnt}</p>
            <p>의과레지던트: {data.mdeptResdntCnt}</p>
            <p>의과전문의: {data.mdeptSdrCnt}</p>
          </main>
          <footer>
            <button className="close" onClick={close}>
              {' '}
              close{' '}
            </button>
          </footer>
        </section>
      ) : null}
    </div>
  );
};

export default Post;
